import React from "react";
import styles from "./ListHeader.module.css"

export const ListHeader = () => {
  return (
    <>
    <div className={styles["header-wrap"]}></div>
      <div>Full name</div>
      <div>Birthday</div>
      <div>Gender</div>
      <div>Department</div>
      <div>Salary</div>
    </>
  );
};
